import React from "react";
import { Link } from 'react-router-dom';

function Navbar() {
    return(
        <>
          <Nav>
            <Link to="/">Home</Link>
            <Link to="/About">About</Link>
            <Link to="/Services">Services</Link>
          </Nav>
        </>
    )
}

export default Navbar;
